INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
(1, 'News', 'News', 'Equotix', 'OC 2.x', '', '<modification>\r\n	<code>News</code>		\r\n	<name>News</name>\r\n	<version>OC 2.x</version>	\r\n	<author>Equotix</author>\r\n	<file path="admin/view/template/common/menu.tpl">\r\n		<operation>\r\n			<search><![CDATA[\r\n				<li><a href="<?php echo $feed; ?>"><?php echo $text_feed; ?></a></li>\r\n			]]></search>\r\n			<add position="after" ><![CDATA[\r\n				<li><a href="<?php echo $news; ?>">News</a></li>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/controller/common/menu.php">\r\n		<operation>\r\n			<search><![CDATA[\r\n				$data[''feed''] = $this->url->link(''extension/feed'', ''token='' . $this->session->data[''token''], ''SSL'');	\r\n			]]></search>\r\n			<add position="after" ><![CDATA[\r\n				$data[''news''] = $this->url->link(''extension/news'', ''token='' . $this->session->data[''token''], ''SSL'');	\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/controller/common/footer.php">\r\n		<operation>\r\n			<search index="1" ><![CDATA[\r\n				$data[''text_account'']\r\n			]]></search>\r\n			<add position="after"><![CDATA[\r\n				$data[''news''] = $this->url->link(''information/news'');\r\n				$data[''text_news''] = $this->language->get(''text_news'');\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/language/*/common/footer.php">\r\n		<operation>\r\n			<search index="1" ><![CDATA[\r\n				$_\r\n			]]></search>\r\n			<add position="after" ><![CDATA[\r\n				$_[''text_news''] = ''Our News'';\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/view/theme/*/template/common/footer.tpl">\r\n		<operation>\r\n			<search><![CDATA[\r\n				<li><a href="<?php echo $voucher; ?>"><?php echo $text_voucher; ?></a></li>\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				<li><a href="<?php echo $news; ?>"><?php echo $text_news; ?></a></li>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/controller/common/seo_url.php">\r\n		<operation>\r\n			<search><![CDATA[\r\n				if ($url[0] == ''information_id'') {\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				if ($url[0] == ''news_id'') {\r\n					$this->request->get[''news_id''] = $url[1];\r\n				}	\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[\r\n				} elseif (isset($this->request->get[''information_id''])) {\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				} elseif (isset($this->request->get[''news_id''])) {\r\n					$this->request->get[''route''] = ''information/news/news'';\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[\r\n				if (($data[''route''] == ''product/product'' && $key == ''product_id'') || (($data[''route''] == ''product/manufacturer/info'' || $data[''route''] == ''product/product'') && $key == ''manufacturer_id'') || ($data[''route''] == ''information/information'' && $key == ''information_id'')) {\r\n			]]></search>\r\n			<add position="replace" ><![CDATA[\r\n				if (($data[''route''] == ''information/news/news'' && $key == ''news_id'') || ($data[''route''] == ''product/product'' && $key == ''product_id'') || (($data[''route''] == ''product/manufacturer/info'' || $data[''route''] == ''product/product'') && $key == ''manufacturer_id'') || ($data[''route''] == ''information/information'' && $key == ''information_id'')) {\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[\r\n				if ($query->row[''query''] && $url[0] != ''information_id'' && $url[0] != ''manufacturer_id'' && $url[0] != ''category_id'' && $url[0] != ''product_id'') {\r\n			]]></search>\r\n			<add position="replace" ><![CDATA[\r\n				if ($query->row[''query''] && $url[0] != ''information_id'' && $url[0] != ''manufacturer_id'' && $url[0] != ''category_id'' && $url[0] != ''product_id'' && $url[0] != ''news_id'') {\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/controller/common/dashboard.php" error="skip">\r\n		<operation>\r\n			<search><![CDATA[\r\n				function index()\r\n			]]></search>\r\n			<add position="after" ><![CDATA[	\r\n				$this->load->model(''setting/news'');\r\n				$results = $this->model_setting_news->getNews();\r\n				$data[''json''] = json_decode($results[''text''], true);\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/view/template/common/dashboard.tpl" error="skip">\r\n		<operation>\r\n			<search><![CDATA[\r\n				<?php if ($error_install) { ?>\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				<?php if ($json) { ?>\r\n				<div class="alert alert-info">\r\n					<ul style="margin:0px; padding: 0px;">\r\n					<?php foreach ($json as $value) { ?>\r\n						<li style="margin: 0px 20px;"><?php echo $value[''title'']; ?></li>\r\n					<?php }	?>\r\n					</ul>\r\n				</div>\r\n				<?php } ?>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n</modification>\r\n', 1, '2016-01-12 12:16:56'),
(2, 'Advanced Newsletter Subscribe', 'adv_newsletter', 'anh.to87@gmail.com', '1.0', 'http://www.opcartstore.com', '<?xml version="1.0" encoding="utf-8"?>\n<modification>\n    <name>Advanced Newsletter Subscribe</name>\n    <code>adv_newsletter</code>\n    <version>1.0</version>\n    <author>anh.to87@gmail.com</author>\n    <link>http://www.opcartstore.com</link>\n    <file path="admin/controller/marketing/contact.php">\n        <operation>\n            <search index="0" trim="true">\n                <![CDATA[$results = $this->model_sale_customer->getCustomers($customer_data);]]>\n            </search>\n            <add position="after">\n                <![CDATA[\n                        $this->load->model(''module/adv_newsletter'');\n                        $emails_newsletter    = $this->model_module_adv_newsletter->getEmails();\n\n                        $results = array_merge($results, $emails_newsletter);\n                ]]>\n            </add>\n        </operation>\n    </file>\n</modification>', 1, '2016-01-23 13:27:07'),
(3, 'Articles', 'Articles', 'Equotix', 'OC 2.x', '', '<modification>\r\n	<code>Articles</code>		\r\n	<name>Articles</name>\r\n	<version>OC 2.x</version>	\r\n	<author>Equotix</author>\r\n	<file path="admin/view/template/common/menu.tpl">\r\n		<operation>\r\n			<search><![CDATA[\r\n				<li><a href="<?php echo $feed; ?>"><?php echo $text_feed; ?></a></li>\r\n			]]></search>\r\n			<add position="after" ><![CDATA[\r\n				<li><a href="<?php echo $articles; ?>">Articles</a></li>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/controller/common/menu.php">\r\n		<operation>\r\n			<search><![CDATA[\r\n				$data[''feed''] = $this->url->link(''extension/feed'', ''token='' . $this->session->data[''token''], ''SSL'');	\r\n			]]></search>\r\n			<add position="after" ><![CDATA[\r\n				$data[''articles''] = $this->url->link(''extension/articles'', ''token='' . $this->session->data[''token''], ''SSL'');	\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/controller/common/footer.php">\r\n		<operation>\r\n			<search index="1" ><![CDATA[\r\n				$data[''text_account'']\r\n			]]></search>\r\n			<add position="after"><![CDATA[\r\n				$data[''articles''] = $this->url->link(''information/articles'');\r\n				$data[''text_articles''] = $this->language->get(''text_articles'');\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/language/*/common/footer.php">\r\n		<operation>\r\n			<search index="1" ><![CDATA[\r\n				$_\r\n			]]></search>\r\n			<add position="after" ><![CDATA[\r\n				$_[''text_articles''] = ''Our Articles'';\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/view/theme/*/template/common/footer.tpl">\r\n		<operation>\r\n			<search><![CDATA[\r\n				<li><a href="<?php echo $voucher; ?>"><?php echo $text_voucher; ?></a></li>\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				<li><a href="<?php echo $articles; ?>"><?php echo $text_articles; ?></a></li>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/controller/common/seo_url.php">\r\n		<operation>\r\n			<search><![CDATA[\r\n				if ($url[0] == ''information_id'') {\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				if ($url[0] == ''articles_id'') {\r\n					$this->request->get[''articles_id''] = $url[1];\r\n				}	\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[\r\n				} elseif (isset($this->request->get[''information_id''])) {\r\n			]]></search>\r\n			<add position="before" ><![CDATA[\r\n				} elseif (isset($this->request->get[''articles_id''])) {\r\n					$this->request->get[''route''] = ''information/articles/articles'';\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[\r\n				if (($data[''route''] == ''product/product'' && $key == ''product_id'') || (($data[''route''] == ''product/manufacturer/info'' || $data[''route''] == ''product/product'') && $key == ''manufacturer_id'') || ($data[''route''] == ''information/information'' && $key == ''information_id'')) {\r\n			]]></search>\r\n			<add position="replace" ><![CDATA[\r\n				if (($data[''route''] == ''information/articles/articles'' && $key == ''articles_id'') || ($data[''route''] == ''product/product'' && $key == ''product_id'') || (($data[''route''] == ''product/manufacturer/info'' || $data[''route''] == ''product/product'') && $key == ''manufacturer_id'') || ($data[''route''] == ''information/information'' && $key == ''information_id'')) {\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[\r\n				if ($query->row[''query''] && $url[0] != ''information_id'' && $url[0] != ''manufacturer_id'' && $url[0] != ''category_id'' && $url[0] != ''product_id'') {\r\n			]]></search>\r\n			<add position="replace" ><![CDATA[\r\n				if ($query->row[''query''] && $url[0] != ''information_id'' && $url[0] != ''manufacturer_id'' && $url[0] != ''category_id'' && $url[0] != ''product_id'' && $url[0] != ''articles_id'') {\r\n			]]></add>\r\n		</operation>\r\n	</file